import React from 'react';
import { Box, Container, Typography, Paper, Grid, Avatar } from '@mui/material';
import { styled } from '@mui/system';
import { motion } from 'framer-motion';

const StyledAbout = styled(Box)(({ theme }) => ({
  padding: theme.spacing(8, 0),
  backgroundColor: theme.palette.background.default,
}));

const TeamMember = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  textAlign: 'center',
  height: '100%',
  transition: 'transform 0.3s ease-in-out',
  '&:hover': {
    transform: 'translateY(-8px)',
    boxShadow: theme.shadows[8],
  },
}));

const AboutPage = () => {
  const teamMembers = [
    {
      name: 'John Doe',
      role: 'Founder & Lead Developer',
      bio: 'Passionate about creating engaging puzzle experiences with over 5 years of game development experience.',
      avatar: '/images/avatar1.jpg',
    },
    {
      name: 'Jane Smith',
      role: 'UI/UX Designer',
      bio: 'Dedicated to creating beautiful and intuitive user interfaces that make puzzle solving a joy.',
      avatar: '/images/avatar2.jpg',
    },
    {
      name: 'Alex Johnson',
      role: 'Puzzle Master',
      bio: 'Creates challenging yet solvable puzzles that keep our community coming back for more.',
      avatar: '/images/avatar3.jpg',
    },
  ];

  return (
    <StyledAbout>
      <Container maxWidth="lg">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <Typography 
            variant="h2" 
            component="h1" 
            gutterBottom 
            align="center"
            sx={{
              fontWeight: 700,
              mb: 6,
              background: 'linear-gradient(45deg, #667eea 0%, #764ba2 100%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
            }}
          >
            About Sudoku Master
          </Typography>

          <Typography 
            variant="h5" 
            align="center" 
            color="textSecondary" 
            paragraph
            sx={{ mb: 6, maxWidth: '800px', mx: 'auto' }}
          >
            We're passionate about bringing the joy of Sudoku to puzzle enthusiasts worldwide. 
            Our mission is to create an engaging, challenging, and accessible platform for players of all skill levels.
          </Typography>

          <Box sx={{ my: 8 }}>
            <Typography variant="h4" component="h2" gutterBottom align="center" sx={{ mb: 6 }}>
              Meet Our Team
            </Typography>
            <Grid container spacing={4}>
              {teamMembers.map((member, index) => (
                <Grid item xs={12} md={4} key={index}>
                  <motion.div
                    initial={{ opacity: 0, y: 20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ delay: 0.2 * index }}
                  >
                    <TeamMember elevation={3}>
                      <Avatar 
                        src={member.avatar} 
                        alt={member.name} 
                        sx={{ 
                          width: 120, 
                          height: 120, 
                          mx: 'auto',
                          mb: 2,
                          border: '3px solid',
                          borderColor: 'primary.main',
                        }} 
                      />
                      <Typography variant="h6" component="h3" gutterBottom>
                        {member.name}
                      </Typography>
                      <Typography color="primary" gutterBottom>
                        {member.role}
                      </Typography>
                      <Typography color="textSecondary">
                        {member.bio}
                      </Typography>
                    </TeamMember>
                  </motion.div>
                </Grid>
              ))}
            </Grid>
          </Box>

          <Box sx={{ mt: 12, textAlign: 'center' }}>
            <Typography variant="h4" component="h2" gutterBottom>
              Our Mission
            </Typography>
            <Typography 
              variant="body1" 
              color="textSecondary" 
              sx={{ maxWidth: '800px', mx: 'auto', mb: 4 }}
            >
              At Sudoku Master, we believe in the power of puzzles to entertain, educate, and bring people together. 
              Our platform is designed to provide a seamless and enjoyable Sudoku experience for players of all levels, 
              from beginners to experts. We're committed to continuous improvement and innovation in puzzle gaming.
            </Typography>

            <Typography variant="h6" sx={{ mt: 6, mb: 2 }}>
              Join Our Community
            </Typography>
            <Typography color="textSecondary" paragraph>
              Become part of our growing community of puzzle enthusiasts today!
            </Typography>
          </Box>
        </motion.div>
      </Container>
    </StyledAbout>
  );
};

export default AboutPage;
